import React from "react";

import Header from "../components/Header";
import Card from "../components/Card";

const Homepage = ({ articles }) => {
    const test = {
        id: "1b2fc33d-a234-458a-8db4-d872f03253e9",
        authorId: "8b532b4d-6ce1-4b3e-a139-4dd7e5f97915",
        title: "Inventore rerum rerum ea qui qui recusandae minima aut labore.",
        date: "2019-05-17T02:26:07.165Z",
        summary: "Praesentium impedit ipsam possimus. Tempore cumque accusantium et et omnis. Quis magni quia. Sit atque repellat.",
        body: "Ut quia dolores quas vero delectus possimus deleniti. Iure pariatur omnis placeat velit asperiores dolorem debitis eos amet. Ex distinctio id. Sint doloremque voluptatem reprehenderit dolor et itaque. Ducimus magnam consequatur at beatae porro provident aut eum omnis. Aliquid ut accusantium ipsam.<br>Dolorem minus qui quibusdam temporibus sit rerum doloribus. Expedita possimus consequatur. Nihil distinctio voluptatum inventore temporibus voluptas. Aut molestiae mollitia.<br>Hic est nostrum. Quod optio eius sint blanditiis. Sed perspiciatis eligendi.<br>Inventore dignissimos tenetur et quia dolorem vero. Nobis voluptatem aut nostrum aut. Provident non ut est error illum voluptatem iste est. Possimus blanditiis necessitatibus aut. Impedit earum ad.<br>Aperiam et dicta. Voluptatibus maiores vel quis impedit qui. Placeat reiciendis perspiciatis et doloremque eligendi.<br>Veritatis aut in voluptatem in deleniti consequatur nostrum autem. Ex tenetur necessitatibus praesentium. Omnis rem quibusdam eveniet at quisquam atque in officia. Et sunt accusantium nobis atque minus quis asperiores. Consequuntur quia consequatur expedita.<br>Nostrum quia non rerum illo in fuga. Nihil ut laboriosam adipisci molestiae in ea. Ea fugit dolor ipsum consequatur temporibus rerum. Doloribus delectus laborum facilis aut sed temporibus amet molestiae. Necessitatibus dolores porro molestiae qui sit qui suscipit mollitia. Maiores atque odit quo velit.",
        tags: [
          "accessibility",
          "react",
          "custom-properties",
          "images"
        ]
      }
  return (
    <div>
        <Header/>  
        <p>Welcome to the Homepage</p>
        <div > {/* class="container" */}
            <div class="row">
                
                    <Card
                        article={test[0]}
                    />
               
            </div>
        </div>
    </div>
    
  );
};

export default Homepage;
